query getInternalsQuery($moduleId: Int!, $applicableSection: String!, $dimension: String!, $categoryId: Int!, $subcategoryId: Int!) {
  getInternals(moduleId: $moduleId, applicableSection: $applicableSection, dimension: $dimension, categoryId: $categoryId, subcategoryId: $subcategoryId) {
    internalId
    internalName
    internalDescription
    image
    brand
    lifestyle
    height
    accessories {
      code
      name
      imageUrl
      minQty
      maxQty
      __typename
    }
    __typename
  }
}
